import React from 'react';
import './styleComponents.css'
import Key from './Key';

const NumPad = () => {
  const keys1 = ["7", "8", "9"];
  const keys2 = ["4", "5", "6"];
  const keys3 = ["1", "2", "3"];
  const keys4 = ["0", "ENTER"];

  return (
    <div className='keyboard'>
      <div className='line'>
        {keys1.map((key) => 
         { return <Key keyVal={key} />;}
        )}
      </div>
      <div className='line'>
        {keys2.map((key) => (
          <div key={key}>{key}</div>
        ))}
      </div>
      <div className='line'>
        {keys3.map((key) => (
          <div key={key}>{key}</div>
        ))}
      </div>
      <div className='line'>
        {keys4.map((key) => (
          <div key={key}>{key}</div>
        ))}
      </div>
    </div>
  );
};

export default NumPad;
